import {Grid, IconButton, Link,Paper, List, ListItem, ListItemIcon ,ListItemText} from "@material-ui/core";
import HomeIcon from '@material-ui/icons/Home';
import InfoIcon from '@material-ui/icons/Info';
import ContactMailIcon from '@material-ui/icons/ContactMail';
import {makeStyles} from '@material-ui/core/styles';
const useStyles = makeStyles((theme) => ({
    root: {
      backgroundcolor:'red',
    },
  }));
  
export default function Footer(){
    const classes = useStyles();
    return(
        <div className="classes.root">
            <Grid container item justify="center" alignItems="center">
                <List>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><HomeIcon/>Home</IconButton>
                        </Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><InfoIcon/>About</IconButton>
                        </Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><ContactMailIcon/>Home</IconButton>
                        </Link>
                    </ListItem>
                </List>
            </Grid>
        </div>
    );
}
